             isLoggedIn : true
        }
    }
    
 
    render() {
      
                if (this.state.isLoggedIn) {
                  return  <h1>Hello user</h1>
                } else {
                    return <h1>must loggedIn</h1>
                }
        
        
    }
}

export default Conditional
